  return (<><nav class="navbar navbar-light navbar-expand-md py-3 fixed-top blur-background">
  <div class="container"><a class="navbar-brand d-flex align-items-center" href="#"><span>Brand</span></a><button
          type="button" class="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#navcol-2">
