      <div class="collapse navbar-collapse flex-row justify-content-center align-items-center navbar-menu"
          id="navcol-2">
          <ul class="navbar-nav ms-auto">
              <li class="nav-item"><a class="nav-link active" href="#home">Home</a></li>
              <li class="nav-item"><a class="nav-link active" href="#">ABOUT</a></li>
              <li class="nav-item"><a class="nav-link active" href="#">Courses</a></li>
              <li class="nav-item"><a class="nav-link active" href="#">BLOG</a></li>
              <li class="nav-item"><a class="nav-link active" href="#">CONTACT</a></li>
          </ul><a class="btn my-btn" href="#"><span>Login&nbsp;</span><svg xmlns="http://www.w3.org/2000/svg"
